"    <div id=\"topicTitle\">",
"     Patient information: Lupus and kidney disease (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H715373382\">",
"      <span class=\"h1\">",
"       What does kidney disease have to do with lupus?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People with lupus are much more likely to have kidney disease than people who don&rsquo;t have lupus. The kidneys are organs in the urinary tract that filter the blood and make urine (",
"      <a class=\"graphic graphic_figure graphicRef79864 \" href=\"mobipreview.htm?26/28/27072\">",
"       figure 1",
"      </a>",
"      ). Kidney disease can cause swelling, high blood pressure, and other symptoms.",
"     </p>",
"     <p>",
"      &ldquo;Lupus nephritis&rdquo; is the medical name for a type of kidney disease that happens in people with lupus. But people who have lupus can also get kidney disease caused by other problems. For example, if someone with lupus also has diabetes, the diabetes might be the cause of kidney problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H715373416\">",
"      <span class=\"h1\">",
"       What are the symptoms of lupus nephritis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Some people with lupus nephritis don&rsquo;t have symptoms. But about half of all people with lupus do. Symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Swelling &ndash; This can be in the hands, face, feet, belly, or around the eyes.",
"       </li>",
"       <li>",
"        Weight changes &ndash; Many people gain weight, but some people lose weight without trying to.",
"       </li>",
"       <li>",
"        Tiredness",
"       </li>",
"       <li>",
"        Urine that looks brown or foamy",
"       </li>",
"       <li>",
"        Urinating less often than normal",
"       </li>",
"       <li>",
"        High blood pressure (higher than",
"        <span class=\"nowrap\">",
"         140/90)",
"        </span>",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H715373431\">",
"      <span class=\"h1\">",
"       Is there a test for lupus nephritis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If you have lupus, your doctor or nurse will do regular blood and urine tests to check for signs of lupus nephritis. You might also have a test called a &ldquo;biopsy.&rdquo; In this test, a doctor takes a small sample of kidney tissue. Another doctor looks at the sample under a microscope to check for kidney disease.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H715373446\">",
"      <span class=\"h1\">",
"       How is lupus nephritis treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Medicines are usually the first treatment for lupus nephritis. These include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines to partly &ldquo;turn off&rdquo; the immune system &ndash; In lupus, the body&rsquo;s immune system attacks healthy cells. Medicines that partly turn it off can slow down the damage lupus causes in the kidneys. There are many different medicines doctors use to treat the immune system. The doctor might:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Try 1 or 2 medicines to find the 1 that works best",
"       </li>",
"       <li>",
"        Give you more than 1 medicine at a time",
"       </li>",
"       <li>",
"        Have you switch to a different medicine when the lupus nephritis is under control",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines called &ldquo;ACE inhibitors&rdquo; or &ldquo;angiotensin receptor blockers&rdquo; &ndash; These medicines can help with kidney damage from lupus nephritis.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Severe lupus nephritis can make the kidneys stop working. If this happens, treatment options include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Hemodialysis, often called &ldquo;dialysis&rdquo; &ndash; A machine filters your blood every few days (",
"        <a class=\"graphic graphic_figure graphicRef56992 \" href=\"mobipreview.htm?0/5/93\">",
"         figure 2",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        Peritoneal dialysis &ndash; A fluid is piped in and out of your belly every day (",
"        <a class=\"graphic graphic_figure graphicRef71539 \" href=\"mobipreview.htm?25/22/25952\">",
"         figure 3",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        Kidney transplant &ndash; Doctors replace your kidneys with a healthy kidney from a donor (",
"        <a class=\"graphic graphic_figure graphicRef59957 \" href=\"mobipreview.htm?36/59/37809\">",
"         figure 4",
"        </a>",
"        ). (People only need 1 working kidney to live.)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H715373530\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Getting pregnant when you have lupus nephritis can be risky. It can increase the chance that the unborn baby will die before birth. Being pregnant can also make lupus nephritis worse.",
"     </p>",
"     <p>",
"      If you want to get pregnant, talk to your doctor or nurse before you start trying to get pregnant. There are ways to reduce the chances of having problems. For example, it is important to wait until you have not had lupus nephritis symptoms for at least 6 months. Your doctor can work with you to try to make this happen.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H715373545\">",
"      <span class=\"h1\">",
"       What will my life be like?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People with lupus must take medicine to control the symptoms and slow down the disease. This is true for people with lupus nephritis, too. Lupus nephritis sometimes goes away on its own. Other times, symptoms come back after treatment. Your doctor or nurse will work with you to treat them if this happens to you.",
"     </p>",
