"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Avoid",
"      </td>",
"      <td class=\"subtitle1\">",
"       Substitute",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"2\">",
"       Pantyhose",
"      </td>",
"      <td>",
"       Stockings with a garter belt",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Thigh high or knee high stockings",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Synthetic underwear",
"      </td>",
"      <td>",
"       Cotton underwear or no underwear",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Jeans and other tight pants",
"      </td>",
"      <td>",
"       Loose pants, skirts, dresses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Swimsuits, leotards, thongs, lycra garments",
"      </td>",
"      <td>",
"       Loose-fitting cotton garments",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pantyliners",
"      </td>",
"      <td>",
"       Tampons or cotton pads",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Scented soaps or shampoos",
"      </td>",
"      <td>",
"       Fragrance free pH neutral soap (eg, Basis, Neutrogena, Dove soap)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Bubble bath",
"      </td>",
"      <td>",
"       Tub baths in the morning and at night without additives and at a comfortable temperature",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Scented detergents",
"      </td>",
"      <td>",
"       Unscented detergents",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Washcloths",
"      </td>",
"      <td>",
"       Use fingertips for washing; pat dry, don't rub dry",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Feminine sprays, douches, powders",
"      </td>",
"      <td>",
"       These are not necessary products and can be omitted from personal practices",
